var documenterSearchIndex = {"docs":
[{"location":"api/#API","page":"API","title":"API","text":"","category":"section"},{"location":"api/#Types","page":"API","title":"Types","text":"","category":"section"},{"location":"api/","page":"API","title":"API","text":"StableRulesClassifier\nStableForestClassifier","category":"page"},{"location":"api/#StableTrees.StableRulesClassifier","page":"API","title":"StableTrees.StableRulesClassifier","text":"StableRulesClassifier(;\n    rng::AbstractRNG=default_rng(),\n    partial_sampling::Real=0.7,\n    n_trees::Int=1_000,\n    max_depth::Int=2,\n    q::Int=10,\n    min_data_in_leaf::Int=5,\n    max_rules::Int=10,\n    weight_penalty::Float64=0.3,\n) -> MLJModelInterface.Probabilistic\n\nExplainable rule-based model based on a random forest. This SIRUS algorithm extracts rules from a stabilized random forest. See the main page of the documentation for details about how it works.\n\nExample\n\nThe classifier satisfies the MLJ interface, so it can be used like any other MLJ model. For example, it can be used to create a machine:\n\njulia> using StableTrees, MLJ\n\njulia> mach = machine(StableRulesClassifier(; max_rules=15), X, y);\n\nArguments\n\nrng: Random number generator. StableRNGs are advised.\npartial_sampling:   Ratio of samples to use in each subset of the data.   The default of 0.7 should be fine for most cases.\nn_trees:   The number of trees to use.   The higher the number, the more likely it is that the correct rules are extracted from the trees, but also the longer model fitting will take.   In most cases, 1000 rules should be more than enough, but it might be useful to run 2000 rules one time and verify that the model performance does not change much.\nmax_depth:   The depth of the tree.   A lower depth decreases model complexity and can therefore improve accuracy when the sample size is small (reduce overfitting).\nq: Number of cutpoints to use per feature.   The default value of 10 should be good for most situations.\nmin_data_in_leaf: Minimum number of data points per leaf.\nmax_rules:   This is the most important hyperparameter.   In general, the more rules, the more accurate the model.   However, more rules will also decrease model interpretability.   So, it is important to find a good balance here.   In most cases, 10-40 rules should provide reasonable accuracy while remaining interpretable.\nweight_penalty:   This penalty regularizes the weights a bit.   Please don't use this hyperparameter.   It is likely to change in the future and it also doesn't have much of an effect.\n\n\n\n\n\n","category":"type"},{"location":"api/#StableTrees.StableForestClassifier","page":"API","title":"StableTrees.StableForestClassifier","text":"StableForestClassifier(;\n    rng::AbstractRNG=default_rng(),\n    partial_sampling::Real=0.7,\n    n_trees::Int=1_000,\n    max_depth::Int=2,\n    q::Int=10,\n    min_data_in_leaf::Int=5\n) <: MLJModelInterface.Probabilistic\n\nRandom forest classifier with a stabilized forest structure (Bénard et al., 2021). This stabilization increases stability when extracting rules. The impact on the predictive accuracy compared to standard random forests should be relatively small.\n\nnote: Note\nJust like normal random forests, this model is not easily explainable. If you are interested in an explainable model, use the StableRulesClassifier.\n\nExample\n\nThe classifier satisfies the MLJ interface, so it can be used like any other MLJ model. For example, it can be used to create a machine:\n\njulia> using StableTrees, MLJ\n\njulia> mach = machine(StableForestClassifier(), X, y);\n\nArguments\n\nrng: Random number generator. StableRNGs are advised.\npartial_sampling:   Ratio of samples to use in each subset of the data.   The default of 0.7 should be fine for most cases.\nn_trees: The number of trees to use.\nmax_depth:   The depth of the tree.   A lower depth decreases model complexity and can therefore improve accuracy when the sample size is small (reduce overfitting).\nq: Number of cutpoints to use per feature.   The default value of 10 should be good for most situations.\nmin_data_in_leaf: Minimum number of data points per leaf.\n\n\n\n\n\n","category":"type"},{"location":"api/#Methods","page":"API","title":"Methods","text":"","category":"section"},{"location":"api/","page":"API","title":"API","text":"feature_names\ndirections\nvalues(::StableTrees.Rule)","category":"page"},{"location":"api/#StableTrees.feature_names","page":"API","title":"StableTrees.feature_names","text":"feature_names(rule::Rule) -> Vector{String}\n\nReturn a vector of feature names; one for each clause in rule.\n\n\n\n\n\n","category":"function"},{"location":"api/#StableTrees.directions","page":"API","title":"StableTrees.directions","text":"directions(rule::Rule) -> Vector{Symbol}\n\nReturn a vector of split directions; one for each clause in rule.\n\n\n\n\n\n","category":"function"},{"location":"api/#Base.values-Tuple{StableTrees.Rule}","page":"API","title":"Base.values","text":"values(rule::Rule) -> Vector{Float64}\n\nReturn a vector split values; one for each clause in rule.\n\n\n\n\n\n","category":"method"},{"location":"","page":"StableTrees","title":"StableTrees","text":"<style>\n    table {\n        display: table !important;\n        margin: 2rem auto !important;\n        border-top: 2pt solid rgba(0,0,0,0.2);\n        border-bottom: 2pt solid rgba(0,0,0,0.2);\n    }\n\n    pre, div {\n        margin-top: 1.4rem !important;\n        margin-bottom: 1.4rem !important;\n    }\n\n    .code-output {\n        padding: 0.7rem 0.5rem !important;\n    }\n\n    .admonition-body {\n        padding: 0em 1.25em !important;\n    }\n</style>\n\n<!-- PlutoStaticHTML.Begin -->\n<!--\n    # This information is used for caching.\n    [PlutoStaticHTML.State]\n    input_sha = \"23235c54281c86a531c871a20c3514d5f331484b1f11e6ea786bd1d665b881f9\"\n    julia_version = \"1.8.2\"\n-->\n\n\n\n\n<script>\n\t\nconst indent = true\nconst aside = true\nconst title_text = \"Table of Contents\"\nconst include_definitions = false\n\n\nconst tocNode = html`<nav class=\"plutoui-toc\">\n\t<header>\n\t <span class=\"toc-toggle open-toc\"></span>\n\t <span class=\"toc-toggle closed-toc\"></span>\n\t ${title_text}\n\t</header>\n\t<section></section>\n</nav>`\n\ntocNode.classList.toggle(\"aside\", aside)\ntocNode.classList.toggle(\"indent\", indent)\n\n\nconst getParentCell = el => el.closest(\"pluto-cell\")\n\nconst getHeaders = () => {\n\tconst depth = Math.max(1, Math.min(6, 3)) // should be in range 1:6\n\tconst range = Array.from({length: depth}, (x, i) => i+1) // [1, ..., depth]\n\t\n\tconst selector = [\n\t\t...(include_definitions ? [\n\t\t\t`pluto-notebook pluto-cell .pluto-docs-binding`, \n\t\t\t`pluto-notebook pluto-cell assignee:not(:empty)`, \n\t\t] : []),\n\t\t...range.map(i => `pluto-notebook pluto-cell h${i}`)\n\t].join(\",\")\n\treturn Array.from(document.querySelectorAll(selector)).filter(el => \n\t\t// exclude headers inside of a pluto-docs-binding block\n\t\t!(el.nodeName.startsWith(\"H\") && el.closest(\".pluto-docs-binding\"))\n\t)\n}\n\n\nconst document_click_handler = (event) => {\n\tconst path = (event.path || event.composedPath())\n\tconst toc = path.find(elem => elem?.classList?.contains?.(\"toc-toggle\"))\n\tif (toc) {\n\t\tevent.stopImmediatePropagation()\n\t\ttoc.closest(\".plutoui-toc\").classList.toggle(\"hide\")\n\t}\n}\n\ndocument.addEventListener(\"click\", document_click_handler)\n\n\nconst header_to_index_entry_map = new Map()\nconst currently_highlighted_set = new Set()\n\nconst last_toc_element_click_time = { current: 0 }\n\nconst intersection_callback = (ixs) => {\n\tlet on_top = ixs.filter(ix => ix.intersectionRatio > 0 && ix.intersectionRect.y < ix.rootBounds.height / 2)\n\tif(on_top.length > 0){\n\t\tcurrently_highlighted_set.forEach(a => a.classList.remove(\"in-view\"))\n\t\tcurrently_highlighted_set.clear()\n\t\ton_top.slice(0,1).forEach(i => {\n\t\t\tlet div = header_to_index_entry_map.get(i.target)\n\t\t\tdiv.classList.add(\"in-view\")\n\t\t\tcurrently_highlighted_set.add(div)\n\t\t\t\n\t\t\t/// scroll into view\n\t\t\t/*\n\t\t\tconst toc_height = tocNode.offsetHeight\n\t\t\tconst div_pos = div.offsetTop\n\t\t\tconst div_height = div.offsetHeight\n\t\t\tconst current_scroll = tocNode.scrollTop\n\t\t\tconst header_height = tocNode.querySelector(\"header\").offsetHeight\n\t\t\t\n\t\t\tconst scroll_to_top = div_pos - header_height\n\t\t\tconst scroll_to_bottom = div_pos + div_height - toc_height\n\t\t\t\n\t\t\t// if we set a scrollTop, then the browser will stop any currently ongoing smoothscroll animation. So let's only do this if you are not currently in a smoothscroll.\n\t\t\tif(Date.now() - last_toc_element_click_time.current >= 2000)\n\t\t\t\tif(current_scroll < scroll_to_bottom){\n\t\t\t\t\ttocNode.scrollTop = scroll_to_bottom\n\t\t\t\t} else if(current_scroll > scroll_to_top){\n\t\t\t\t\ttocNode.scrollTop = scroll_to_top\n\t\t\t\t}\n\t\t\t*/\n\t\t})\n\t}\n}\nlet intersection_observer_1 = new IntersectionObserver(intersection_callback, {\n\troot: null, // i.e. the viewport\n  \tthreshold: 1,\n\trootMargin: \"-15px\", // slightly smaller than the viewport\n\t// delay: 100,\n})\nlet intersection_observer_2 = new IntersectionObserver(intersection_callback, {\n\troot: null, // i.e. the viewport\n  \tthreshold: 1,\n\trootMargin: \"15px\", // slightly larger than the viewport\n\t// delay: 100,\n})\n\nconst render = (elements) => {\n\theader_to_index_entry_map.clear()\n\tcurrently_highlighted_set.clear()\n\tintersection_observer_1.disconnect()\n\tintersection_observer_2.disconnect()\n\n\t\tlet last_level = `H1`\n\treturn html`${elements.map(h => {\n\tconst parent_cell = getParentCell(h)\n\n\t\tlet [className, title_el] = h.matches(`.pluto-docs-binding`) ? [\"pluto-docs-binding-el\", h.firstElementChild] : [h.nodeName, h]\n\n\tconst a = html`<a \n\t\tclass=\"${className}\" \n\t\ttitle=\"${title_el.innerText}\"\n\t\thref=\"#${parent_cell.id}\"\n\t>${title_el.innerHTML}</a>`\n\t/* a.onmouseover=()=>{\n\t\tparent_cell.firstElementChild.classList.add(\n\t\t\t'highlight-pluto-cell-shoulder'\n\t\t)\n\t}\n\ta.onmouseout=() => {\n\t\tparent_cell.firstElementChild.classList.remove(\n\t\t\t'highlight-pluto-cell-shoulder'\n\t\t)\n\t} */\n\t\t\n\t\t\n\ta.onclick=(e) => {\n\t\te.preventDefault();\n\t\tlast_toc_element_click_time.current = Date.now()\n\t\th.scrollIntoView({\n\t\t\tbehavior: 'smooth', \n\t\t\tblock: 'start'\n\t\t})\n\t}\n\n\tconst row =  html`<div class=\"toc-row ${className} after-${last_level}\">${a}</div>`\n\t\tintersection_observer_1.observe(title_el)\n\t\tintersection_observer_2.observe(title_el)\n\t\theader_to_index_entry_map.set(title_el, row)\n\n\tif(className.startsWith(\"H\"))\n\t\tlast_level = className\n\t\t\n\treturn row\n})}`\n}\n\nconst invalidated = { current: false }\n\nconst updateCallback = () => {\n\tif (!invalidated.current) {\n\t\ttocNode.querySelector(\"section\").replaceWith(\n\t\t\thtml`<section>${render(getHeaders())}</section>`\n\t\t)\n\t}\n}\nupdateCallback()\nsetTimeout(updateCallback, 100)\nsetTimeout(updateCallback, 1000)\nsetTimeout(updateCallback, 5000)\n\nconst notebook = document.querySelector(\"pluto-notebook\")\n\n\n// We have a mutationobserver for each cell:\nconst mut_observers = {\n\tcurrent: [],\n}\n\nconst createCellObservers = () => {\n\tmut_observers.current.forEach((o) => o.disconnect())\n\tmut_observers.current = Array.from(notebook.querySelectorAll(\"pluto-cell\")).map(el => {\n\t\tconst o = new MutationObserver(updateCallback)\n\t\to.observe(el, {attributeFilter: [\"class\"]})\n\t\treturn o\n\t})\n}\ncreateCellObservers()\n\n// And one for the notebook's child list, which updates our cell observers:\nconst notebookObserver = new MutationObserver(() => {\n\tupdateCallback()\n\tcreateCellObservers()\n})\nnotebookObserver.observe(notebook, {childList: true})\n\n// And finally, an observer for the document.body classList, to make sure that the toc also works when it is loaded during notebook initialization\nconst bodyClassObserver = new MutationObserver(updateCallback)\nbodyClassObserver.observe(document.body, {attributeFilter: [\"class\"]})\n\n// Hide/show the ToC when the screen gets small\nlet m = matchMedia(\"(max-width: 1000px)\")\nlet match_listener = () => \n\ttocNode.classList.toggle(\"hide\", m.matches)\nmatch_listener()\nm.addListener(match_listener)\n\ninvalidation.then(() => {\n\tinvalidated.current = true\n\tintersection_observer_1.disconnect()\n\tintersection_observer_2.disconnect()\n\tnotebookObserver.disconnect()\n\tbodyClassObserver.disconnect()\n\tmut_observers.current.forEach((o) => o.disconnect())\n\tdocument.removeEventListener(\"click\", document_click_handler)\n\tm.removeListener(match_listener)\n})\n\nreturn tocNode\n</script>\n<style>\n@media not print {\n\n.plutoui-toc {\n\tfont-family: -apple-system, BlinkMacSystemFont, \"Segoe UI\", Roboto, Oxygen-Sans, Cantarell, Helvetica, Arial, \"Apple Color Emoji\",\n\t\t\"Segoe UI Emoji\", \"Segoe UI Symbol\", system-ui, sans-serif;\n\t--main-bg-color: #fafafa;\n\t--pluto-output-color: hsl(0, 0%, 36%);\n\t--pluto-output-h-color: hsl(0, 0%, 21%);\n\t--sidebar-li-active-bg: rgb(235, 235, 235);\n\t--icon-filter: unset;\n}\n\n@media (prefers-color-scheme: dark) {\n\t.plutoui-toc {\n\t\t--main-bg-color: #303030;\n\t\t--pluto-output-color: hsl(0, 0%, 90%);\n\t\t--pluto-output-h-color: hsl(0, 0%, 97%);\n\t\t--sidebar-li-active-bg: rgb(82, 82, 82);\n\t\t--icon-filter: invert(1);\n\t}\n}\n\n.plutoui-toc.aside {\n\tcolor: var(--pluto-output-color);\n\tposition: fixed;\n\tright: 1rem;\n\ttop: 5rem;\n\twidth: min(80vw, 300px);\n\tpadding: 0.5rem;\n\tpadding-top: 0em;\n\t/* border: 3px solid rgba(0, 0, 0, 0.15); */\n\tborder-radius: 10px;\n\t/* box-shadow: 0 0 11px 0px #00000010; */\n\tmax-height: calc(100vh - 5rem - 90px);\n\toverflow: auto;\n\tz-index: 40;\n\tbackground-color: var(--main-bg-color);\n\ttransition: transform 300ms cubic-bezier(0.18, 0.89, 0.45, 1.12);\n}\n\n.plutoui-toc.aside.hide {\n\ttransform: translateX(calc(100% - 28px));\n}\n.plutoui-toc.aside.hide section {\n\tdisplay: none;\n}\n.plutoui-toc.aside.hide header {\n\tmargin-bottom: 0em;\n\tpadding-bottom: 0em;\n\tborder-bottom: none;\n}\n}  /* End of Media print query */\n.plutoui-toc.aside.hide .open-toc,\n.plutoui-toc.aside:not(.hide) .closed-toc,\n.plutoui-toc:not(.aside) .closed-toc {\n\tdisplay: none;\n}\n\n@media (prefers-reduced-motion) {\n  .plutoui-toc.aside {\n\ttransition-duration: 0s;\n  }\n}\n\n.toc-toggle {\n\tcursor: pointer;\n    padding: 1em;\n    margin: -1em;\n    margin-right: -0.7em;\n    line-height: 1em;\n    display: flex;\n}\n\n.toc-toggle::before {\n    content: \"\";\n    display: inline-block;\n    height: 1em;\n    width: 1em;\n    background-image: url(\"https://cdn.jsdelivr.net/gh/ionic-team/ionicons@5.5.1/src/svg/list-outline.svg\");\n\t/* generated using https://dopiaza.org/tools/datauri/index.php */\n    background-image: url(\"data:image/svg+xml;base64,\");\n    background-size: 1em;\n\tfilter: var(--icon-filter);\n}\n\n.aside .toc-toggle.open-toc:hover::before {\n    background-image: url(\"https://cdn.jsdelivr.net/gh/ionic-team/ionicons@5.5.1/src/svg/arrow-forward-outline.svg\");\n\t/* generated using https://dopiaza.org/tools/datauri/index.php */\n    background-image: url(\"data:image/svg+xml;base64,\");\n}\n.aside .toc-toggle.closed-toc:hover::before {\n    background-image: url(\"https://cdn.jsdelivr.net/gh/ionic-team/ionicons@5.5.1/src/svg/arrow-back-outline.svg\");\n\t/* generated using https://dopiaza.org/tools/datauri/index.php */\n    background-image: url(\"data:image/svg+xml;base64,\");\n}\n\n\n\n.plutoui-toc header {\n\tdisplay: flex;\n\talign-items: center;\n\tgap: .3em;\n\tfont-size: 1.5em;\n\t/* margin-top: -0.1em; */\n\tmargin-bottom: 0.4em;\n\tpadding: 0.5rem;\n\tmargin-left: 0;\n\tmargin-right: 0;\n\tfont-weight: bold;\n\t/* border-bottom: 2px solid rgba(0, 0, 0, 0.15); */\n\tposition: sticky;\n\ttop: 0px;\n\tbackground: var(--main-bg-color);\n\tz-index: 41;\n}\n.plutoui-toc.aside header {\n\tpadding-left: 0;\n\tpadding-right: 0;\n}\n\n.plutoui-toc section .toc-row {\n\twhite-space: nowrap;\n\toverflow: hidden;\n\ttext-overflow: ellipsis;\n\tpadding: .1em;\n\tborder-radius: .2em;\n}\n\n.plutoui-toc section .toc-row.H1 {\n\tmargin-top: 1em;\n}\n\n\n.plutoui-toc.aside section .toc-row.in-view {\n\tbackground: var(--sidebar-li-active-bg);\n}\n\n\n\t\n.highlight-pluto-cell-shoulder {\n\tbackground: rgba(0, 0, 0, 0.05);\n\tbackground-clip: padding-box;\n}\n\n.plutoui-toc section a {\n\ttext-decoration: none;\n\tfont-weight: normal;\n\tcolor: var(--pluto-output-color);\n}\n.plutoui-toc section a:hover {\n\tcolor: var(--pluto-output-h-color);\n}\n\n.plutoui-toc.indent section a.H1 {\n\tfont-weight: 700;\n\tline-height: 1em;\n}\n\n.plutoui-toc.indent section .after-H2 a { padding-left: 10px; }\n.plutoui-toc.indent section .after-H3 a { padding-left: 20px; }\n.plutoui-toc.indent section .after-H4 a { padding-left: 30px; }\n.plutoui-toc.indent section .after-H5 a { padding-left: 40px; }\n.plutoui-toc.indent section .after-H6 a { padding-left: 50px; }\n\n.plutoui-toc.indent section a.H1 { padding-left: 0px; }\n.plutoui-toc.indent section a.H2 { padding-left: 10px; }\n.plutoui-toc.indent section a.H3 { padding-left: 20px; }\n.plutoui-toc.indent section a.H4 { padding-left: 30px; }\n.plutoui-toc.indent section a.H5 { padding-left: 40px; }\n.plutoui-toc.indent section a.H6 { padding-left: 50px; }\n\n\n.plutoui-toc.indent section a.pluto-docs-binding-el,\n.plutoui-toc.indent section a.ASSIGNEE\n\t{\n\tfont-family: JuliaMono, monospace;\n\tfont-size: .8em;\n\t/* background: black; */\n\tfont-weight: 700;\n    font-style: italic;\n\tcolor: var(--cm-var-color); /* this is stealing a variable from Pluto, but it's fine if that doesnt work */\n}\n.plutoui-toc.indent section a.pluto-docs-binding-el::before,\n.plutoui-toc.indent section a.ASSIGNEE::before\n\t{\n\tcontent: \"> \";\n\topacity: .3;\n}\n</style>\n\n\n\n<div class=\"markdown\"><p>This package is a pure Julia implementation of the <strong>S</strong>table and <strong>I</strong>nterpretable <strong>RU</strong>le <strong>S</strong>ets &#40;SIRUS&#41; algorithm. This package has only implemented binary classification for now. Regression and multiclass-classification will be implemented later. For R users, the SIRUS package is also available via <a href=\"https://cran.r-project.org/web/packages/sirus/index.html\">CRAN</a>.</p>\n<p>The algorithm is based on random forests. However, compared to random forests, the model is much more interpretable since the forests are converted to a set of decison rules. This page will provide an overview of the algorithm and describe not only how it can be used but also how it works. To do this, let&#39;s start by briefly describing random forests.</p>\n</div>\n\n","category":"page"},{"location":"#Random-forests","page":"StableTrees","title":"Random forests","text":"","category":"section"},{"location":"","page":"StableTrees","title":"StableTrees","text":"<div class=\"markdown\">\n\n<p>Random forests are known to produce accurate predictions especially in settings where the number of features <code>p</code> is close to or higher than the number of observations <code>n</code> &#40;Biau &amp; Scornet, <a href=\"https://doi.org/10.1007/s11749-016-0481-7\">2016</a>&#41;. Let&#39;s start by explaining the building blocks of random forests: decision trees. As an example, we take Haberman&#39;s Survival Data Set &#40;see the Appendix below for more details&#41;:</p>\n</div>\n\n<pre class='language-julia'><code class='language-julia'>data = _haberman()</code></pre>\n<table>\n<tr>\n<th></th>\n<th>age</th>\n<th>year</th>\n<th>nodes</th>\n<th>survival</th>\n</tr>\n<tr>\n<td>1</td>\n<td>30.0</td>\n<td>1964.0</td>\n<td>1.0</td>\n<td>1</td>\n</tr>\n<tr>\n<td>2</td>\n<td>30.0</td>\n<td>1962.0</td>\n<td>3.0</td>\n<td>1</td>\n</tr>\n<tr>\n<td>3</td>\n<td>30.0</td>\n<td>1965.0</td>\n<td>0.0</td>\n<td>1</td>\n</tr>\n<tr>\n<td>4</td>\n<td>31.0</td>\n<td>1959.0</td>\n<td>2.0</td>\n<td>1</td>\n</tr>\n<tr>\n<td>5</td>\n<td>31.0</td>\n<td>1965.0</td>\n<td>4.0</td>\n<td>1</td>\n</tr>\n<tr>\n<td>6</td>\n<td>33.0</td>\n<td>1958.0</td>\n<td>10.0</td>\n<td>1</td>\n</tr>\n<tr>\n<td>7</td>\n<td>33.0</td>\n<td>1960.0</td>\n<td>0.0</td>\n<td>1</td>\n</tr>\n<tr>\n<td>8</td>\n<td>34.0</td>\n<td>1959.0</td>\n<td>0.0</td>\n<td>0</td>\n</tr>\n<tr>\n<td>9</td>\n<td>34.0</td>\n<td>1966.0</td>\n<td>9.0</td>\n<td>0</td>\n</tr>\n<tr>\n<td>10</td>\n<td>34.0</td>\n<td>1958.0</td>\n<td>30.0</td>\n<td>1</td>\n</tr>\n<tr>\n<td>...</td>\n</tr>\n<tr>\n<td>306</td>\n<td>83.0</td>\n<td>1958.0</td>\n<td>2.0</td>\n<td>0</td>\n</tr>\n</table>\n\n\n<pre class='language-julia'><code class='language-julia'>X = data[:, Not(:survival)];</code></pre>\n\n\n<pre class='language-julia'><code class='language-julia'>y = data.survival;</code></pre>\n\n\n\n<div class=\"markdown\"><p>This dataset contains observations from a study with patients who had breast cancer. The <code>survival</code> column contains a <code>0</code> if a patient has died within 5 years and <code>1</code> if the patient has survived for at least 5 years. The aim is to predict survival based on the <code>age</code>, the <code>year</code> in which the operation was conducted and the number of detected auxillary <code>nodes</code>.</p>\n</div>\n\n\n<div class=\"markdown\"><p>Via <a href=\"https://github.com/alan-turing-institute/MLJ.jl\"><code>MLJ.jl</code></a>, we can fit multiple decision trees on this dataset:</p>\n</div>\n\n<pre class='language-julia'><code class='language-julia'>tree_evaluations = let\n    model = DecisionTreeClassifier(; max_depth=2, rng=_rng())\n    _evaluate(model, X, y)\nend;</code></pre>\n\n\n\n<div class=\"markdown\"><p>This has fitted various trees to various subsets of the dataset via cross-validation. Here, I&#39;ve set <code>max_depth&#61;2</code> to simplify the fitted trees which makes the tree more easily explainable. Also, for our small dataset, this forces the model to remain simple so it likely reduces overfitting. Let&#39;s look at the first tree:</p>\n</div>\n\n<pre class='language-julia'><code class='language-julia'>let\n    tree = tree_evaluations.fitted_params_per_fold[1].tree\n    _io2text() do io\n        DecisionTree.print_tree(io, tree; feature_names=names(data))\n    end\nend</code></pre>\n<pre id='var-hash904630' class='code-output documenter-example-output'>Feature 3: \"nodes\" < 2.5 ?\n├─ Feature 1: \"age\" < 79.5 ?\n    ├─ 2 : 151/178\n    └─ 1 : 1/1\n└─ Feature 1: \"age\" < 43.5 ?\n    ├─ 2 : 16/20\n    └─ 1 : 42/76\n</pre>\n\n\n<div class=\"markdown\"><p>What this shows is that the first tree decided that the <code>nodes</code> feature is the most helpful in deciding who will survive for 5 more years. Next, if the <code>nodes</code> feature is below 2.5, then <code>age</code> will be selected on. If <code>age &lt; 79.5</code>, then the model will predict the second class and if <code>age ≥ 79.5</code> it will predict the first class. Similarly for <code>age &lt; 43.5</code>. Now, let&#39;s see what happens for a slight change in the data. In other words, let&#39;s see how the fitted model for the second split looks:</p>\n</div>\n\n<pre class='language-julia'><code class='language-julia'>let\n    tree = tree_evaluations.fitted_params_per_fold[2].tree\n    _io2text() do io\n        DecisionTree.print_tree(io, tree; feature_names=names(data))\n    end\nend</code></pre>\n<pre id='var-hash126251' class='code-output documenter-example-output'>Feature 3: \"nodes\" < 2.5 ?\n├─ Feature 1: \"age\" < 77.0 ?\n    ├─ 2 : 147/175\n    └─ 1 : 2/2\n└─ Feature 1: \"age\" < 43.5 ?\n    ├─ 2 : 18/21\n    └─ 1 : 41/77\n</pre>\n\n\n<div class=\"markdown\"><p>This shows that the features and the values for the splitpoints are not the same for both trees. This is called stability. Or in this case, a decision tree is considered to be unstable. This instability is problematic in situations where real-world decisions are based on the outcome of the model. Imagine using this model for the selecting which students are allowed to enter some university. If the model is updated every year with the data from the last year, then the selection criteria would vary wildly per year. This instability also causes accuracy to fluctuate wildly. Intuitively, this makes sense: if the model changes wildly for small data changes, then model accuracy also changes wildly. This intuitively also implies that the model is more likely to overfit. This is why random forests were introduced. Basically, random forests fit a large number of trees and average their predictions to come to a more accurate prediction. The individual trees are obtained by restricting the observations and the features that the trees are allowed to use. For the restriction on the observations, the trees are only allowed to see <code>partial_sampling * n</code> observations. In practise, <code>partial_sampling</code> is often 0.7. The restriction on the features is defined in such a way that it guarantees that not every tree will take the same split at the root of the tree. This makes the trees less correlated &#40;James et al., <a href=\"https://doi.org/10.1007/978-1-0716-1418-1\">2021</a>; Section 8.2.2&#41; and, hence, more accurate.</p>\n<p>Unfortunately, these random forests are hard to interpret. To interpret the model, individuals would need to interpret hundreds to thousands of trees containing multiple levels. Alternatively, methods have been created to visualize these uninterpretable models &#40;for example, see Molnar &#40;<a href=\"https://christophm.github.io/interpretable-ml-book/\">2022</a>&#41;; Chapters 6, 7 and 8&#41;. The most promising one of these methods are Shapley values and SHAP. These methods show which features have the highest influence on the prediction. See my blog post on <a href=\"https://huijzer.xyz/posts/shapley/\">Random forests and Shapley values</a> for more information. Knowing which features have the highest influence is nice, but they do not state exactly what feature is used and at what cutoff. Again, this is not good enough for selecting students into universities. For example, what if the government decides to ask for details about the selection? The only answer that you can give is that some features are used for selection more than others and that they are on average used in a certain direction. If the government asks for biases in the model, then these are impossible to report. In practice, the decision is still a black-box. SIRUS solves this by extracting easily interpretable rules from the random forests.</p>\n</div>\n\n","category":"page"},{"location":"#Rule-based-models","page":"StableTrees","title":"Rule-based models","text":"","category":"section"},{"location":"","page":"StableTrees","title":"StableTrees","text":"<div class=\"markdown\">\n\n<p>Rule-based models promise much greater interpretability than random forests. Instead of returning a large number of trees, rule-based models return a set of rules. Each rule can be interpreted on its own and the final model aggregates these rules by summing the prediction of each rules. For example, one rule can be:</p>\n<blockquote>\n<p>if <code>nodes &lt; 4.5</code> then chance of survival is 0.6 and if <code>nodes ≥ 4.5</code> then chance of survival is 0.4.</p>\n</blockquote>\n<p>Note that these rules can be extracted quite easily from the decision trees. For splits on the second level of the tree, the rule could look like:</p>\n<blockquote>\n<p>if <code>nodes &lt; 4.5</code> and <code>age &lt; 38.5</code> then chance of survival is 0.8 and otherwise the chance of survival is 0.4.</p>\n</blockquote>\n<p>When applying this extracting of rules to a random forest, there will be thousands of rules. Next, via some heuristic, the most important rules can be localized and these rules then result in the final model. See, for example, RuleFit &#40;Friedman &amp; Popescu, <a href=\"https://www.jstor.org/stable/30245114\">2008</a>&#41;. The problem with this approach is that they are fitted on the unstable decision trees that were shown above. As an example, on time the tree splits on <code>age &lt; 43.5</code> and another time on <code>age &lt; 44.5</code>.</p>\n</div>\n\n","category":"page"},{"location":"#Tree-stabilization","page":"StableTrees","title":"Tree stabilization","text":"","category":"section"},{"location":"","page":"StableTrees","title":"StableTrees","text":"<div class=\"markdown\">\n\n<p>In the papers which introduce SIRUS, Bénard et al. &#40;<a href=\"https://doi.org/10.1214/20-EJS1792\">2021a</a>, <a href=\"https://proceedings.mlr.press/v130/benard21a.html\">2021b</a>&#41; proof that their algorithm is stable and that the other algorithms are not. They achieve their stability by restricting the location at which the splitpoints can be chosen. To see how this works, let&#39;s look at the <code>age</code> feature on its own.</p>\n</div>\n\n<pre class='language-julia'><code class='language-julia'>nodes = sort(data.age);</code></pre>\n\n\n\n\n\n\n<img src=\"data:image/png;base64,\">\n\n\n<div class=\"markdown\"><p>The default random forest algorithm is allowed to choose any location inside this feature to split on. To avoid having to figure out locations by itself, the algorithm will choose on of the datapoints as a split location. So, for example, the following split indicated by the red vertical line would be a valid choice:</p>\n</div>\n\n\n\n\n\n<img src=\"data:image/png;base64,\">\n\n\n<div class=\"markdown\"><p>But what happens if we take a random subset of the data? Say, we take the following subset of length <code>0.7 * length&#40;nodes&#41;</code>:</p>\n</div>\n\n\n\n\n\n\n\n\n<img src=\"data:image/png;base64,\">\n\n\n<div class=\"markdown\"><p>Now, the algorithm would choose a different location and, hence, introduce instability. To solve this, Bénard et al. decided to limit the splitpoints that the algorithm can use to split to data to a pre-defined set of points. For each feature, they find <code>q</code> empirical quantiles where <code>q</code> is typically 10. Let&#39;s overlay these quantiles on top of the <code>age</code> feature:</p>\n</div>\n\n\n<img src=\"data:image/png;base64,\">\n\n\n<div class=\"markdown\"><p>Next, let&#39;s see where the cutpoints are when we take the same random subset as above:</p>\n</div>\n\n\n<img src=\"data:image/png;base64,\">\n\n\n<div class=\"markdown\"><p>As can be seen, many cutpoints are at the same location as before. Furthermore, compared to the unrestricted range, the chance that two different trees who see a different random subset of the data will select the same cutpoint has increased dramatically.</p>\n<p>The benefit of this is that it is now quite easy to extract the most important rules. Rule extraction consists of simplifying them a bit and ordering them by frequency of occurrence. Let&#39;s see how accurate this model is.</p>\n</div>\n\n","category":"page"},{"location":"#Benchmarks","page":"StableTrees","title":"Benchmarks","text":"","category":"section"},{"location":"","page":"StableTrees","title":"StableTrees","text":"<div class=\"markdown\">\n\n<p>Let&#39;s compare the following models:</p>\n<ul>\n<li><p>Decision tree &#40;<code>DecisionTreeClassifier</code>&#41;</p>\n</li>\n<li><p>Stabilized random forest &#40;<code>StableForestClassifier</code>&#41;</p>\n</li>\n<li><p>SIRUS &#40;<code>StableRulesClassifier</code>&#41;</p>\n</li>\n<li><p>LightGBM &#40;<code>LGBMClassifier</code>&#41;</p>\n</li>\n</ul>\n<p>The latter is a state-of-the-art gradient boosting model created by Microsoft. See the Appendix for more details about these results.</p>\n</div>\n\n<pre class='language-julia'><code class='language-julia'>results = let\n    df = DataFrame(getproperty.([e1, e2, e3, e4, e5, e6], :row))\n    rename!(df, :se =&gt; \"1.96*SE\")\nend</code></pre>\n<table>\n<tr>\n<th></th>\n<th>Model</th>\n<th>Hyperparameters</th>\n<th>AUC</th>\n<th>1.96*SE</th>\n</tr>\n<tr>\n<td>1</td>\n<td>\"DecisionTreeClassifier\"</td>\n<td>\"(max_depth = 2,)\"</td>\n<td>0.64</td>\n<td>0.07</td>\n</tr>\n<tr>\n<td>2</td>\n<td>\"StableRulesClassifier\"</td>\n<td>\"(max_rules = 5,)\"</td>\n<td>0.67</td>\n<td>0.05</td>\n</tr>\n<tr>\n<td>3</td>\n<td>\"StableRulesClassifier\"</td>\n<td>\"(max_rules = 25,)\"</td>\n<td>0.69</td>\n<td>0.05</td>\n</tr>\n<tr>\n<td>4</td>\n<td>\"StableRulesClassifier\"</td>\n<td>\"(max_depth = 1,)\"</td>\n<td>0.69</td>\n<td>0.05</td>\n</tr>\n<tr>\n<td>5</td>\n<td>\"StableForestClassifier\"</td>\n<td>\"(max_depth = 2,)\"</td>\n<td>0.7</td>\n<td>0.05</td>\n</tr>\n<tr>\n<td>6</td>\n<td>\"LGBMClassifier\"</td>\n<td>\"(;)\"</td>\n<td>0.71</td>\n<td>0.06</td>\n</tr>\n</table>\n\n\n\n<div class=\"markdown\"><p>We can summarize these results as follows:</p>\n</div>\n\n\n<img src=\"data:image/png;base64,\">\n\n\n<div class=\"markdown\"><p>As can be seen, the score of the stabilized random forest &#40;<code>StableForestClassifier</code>&#41; is almost as good as Microsoft&#39;s classifier &#40;<code>LGBMClassifier</code>&#41;, but both are not interpretable since that requires interpreting thousands of trees. With the rule-based classifier &#40;<code>StableRulesClassifier</code>&#41;, a small amount of predictive performance can be traded for high interpretability. Note that the rule-based classifier may actually be more accurate in practice because verifying and debugging the model is much easier.</p>\n<p>Regarding the hyperparameters, tuning <code>max_rules</code> and <code>max_depth</code> has the most effect. <code>max_rules</code> specifies the number of rules to which the random forest is simplified. Setting to a high number such as 999 makes the predictive performance similar to that of a random forest, but also makes the interpretability as bad as a random forest. Therefore, it makes more sense to truncate the rules to somewhere in the range 5 to 40 to obtain accurate models with high interpretability. <code>max_depth</code> specifies how many levels the trees have. For larger datasets, <code>max_depth&#61;2</code> makes the most sense since it can find more complex patterns in the data. For smaller datasets, <code>max_depth&#61;1</code> makes more sense since it reduces the chance of overfitting. It also simplifies the rules because with <code>max_depth&#61;1</code>, the rule will contain only one conditional &#40;for example, &quot;if A then ...&quot;&#41; versus two conditionals &#40;for example, &quot;if A &amp; B then ...&quot;&#41;. In some cases, model accuracy can be improved by increasing <code>n_trees</code>. The higher this number, the more trees are fitted and, hence, the higher the chance that the right rules are extracted from the trees.</p>\n</div>\n\n","category":"page"},{"location":"#Interpretation","page":"StableTrees","title":"Interpretation","text":"","category":"section"},{"location":"","page":"StableTrees","title":"StableTrees","text":"<div class=\"markdown\">\n\n<p>Finally, let&#39;s interpret the rules that the model has learned. Since we know that the model performs well on the cross-validations, we can fit our preferred model on the complete dataset:</p>\n</div>\n\n<pre class='language-julia'><code class='language-julia'>let\n    model = StableRulesClassifier(; max_depth=1, rng=_rng())\n    mach = machine(model, X, y)\n    fit!(mach)\n    mach.fitresult\nend</code></pre>\n<pre id='var-hash173674' class='code-output documenter-example-output'>StableRules model with 3 rules:\n if X[i, :nodes] < 4.0 then 0.368 else 0.295 +\n if X[i, :age] < 42.0 then 0.274 else 0.242 +\n if X[i, :year] < 1960.0 then 0.117 else 0.134\nand 2 classes: [0.0, 1.0]. \nNote: showing only the probability for class 1.0 since class 0.0 has probability 1 - p.\n</pre>\n\n\n<div class=\"markdown\"><p>The interpretation of the fitted model is as follows. The model has learned three rules for this dataset. For making a prediction for some value at row <code>i</code>, the model will first look at the value for the <code>nodes</code> feature. If that value is below 2.0, then the probability of survival is 0.819 and the probability of not surviving is 1 - 0.819 &#61; 0.181. To see that the 0.819 means survival, see the bottom of the result which states showing only the probability for class 1.0. The value 0.662 is used when the <code>nodes</code> value is greater or equal to 2.0. Similarly, the model will obtain the probabilities for rules 2 and 3. To obtain the final result, the model will take a weighted average over the three rules.</p>\n<p>Intuitively, the 2 of the rules inside the model makes sense. A patient is more likely to survive if the <code>age</code> of the patient and the number of <code>nodes</code> found inside the patient are lower. Why patients operated before the <code>year</code> 1960 are more likely to survive is unclear to me. This could be an indication that the model is wrong or that there is something unexpected going on. We investigate this perculiarity by visualizing the model.</p>\n</div>\n\n","category":"page"},{"location":"#Visualization","page":"StableTrees","title":"Visualization","text":"","category":"section"},{"location":"","page":"StableTrees","title":"StableTrees","text":"<div class=\"markdown\">\n\n<p>Since our rules are relatively simple with only a binary outcome and only one clause in each rule, the following figure is a way to visualize the obtained rules per fold. For multiple clauses, I would not know how to visualize the rules. Also, this plot is probably not perfect; let me know if you have suggestions.</p>\n<p>What this visualization shows is an arrow for each rule in each fitted model. The vertical position is determined by the weight of the rule, the horizontal position by the location of the splitpoint, and the rotation of the arrow by the difference between the &quot;then&quot; and the &quot;else&quot; probability for class 1.0 &#40;survival&#41;. So, in this case, one arrow located at 41 in the <code>age</code> feature at height 0.2 with a small rotation towards the left means that there was rule in one model in the cross-validation folds which concluded that patients with an <code>age</code> below 41 are more slightly likely to survive for at least 5 years than patients with an <code>age</code> above 41. Compared to some arrows having a height of 0.6 in the <code>nodes</code> feature, the age plays a not so big role here.</p>\n<p>In the background, a histogram of the data is shown. The histogram is scaled to the highest arrow in all features meaning that each y-axis in this plot has the same height.</p>\n</div>\n\n\n<img src=\"data:image/png;base64,\">\n\n\n\n\n\n<div class=\"markdown\"><p>What this plot shows is that the <code>nodes</code> feature is on average chosen as the feature with the most predictive power. This can be concluded from the fact that the arrows are located higher than the arrows for the other features. Furthermore, there is unfortunately some unstability in the position of the splitpoint for the <code>nodes</code> feature. Some models split the data at around 3 and others at around 8. Depending on the context in which this model is used, it might thus be beneficial to decrease the number of empirical quantiles <code>q</code> that the model can use to split on. By default <code>q&#61;10</code>, but maybe something like <code>q&#61;3</code> would make more sense here.</p>\n<p>For the other features, we can see that <code>age</code> is second best in predictive power and <code>year</code> the third best, that is, <code>year</code> actually performs pretty bad. Based on the fact that <code>year</code> is very unstable and that the arrow directions don&#39;t agree, it might be better to remove the feature altogether.</p>\n<p>This visualization might be the solution to the problem posed in the previous section. Apparently, the model fitted on <code>year</code> even though the feature has little predictive power. Indeed, removing the feature from the dataset appears to have almost no effect on the accuracy:</p>\n</div>\n\n<pre class='language-julia'><code class='language-julia'>Base.Text(string(\"Full dataset AUC: \", _score(e4.e)))</code></pre>\n<pre id='var-hash883963' class='code-output documenter-example-output'>Full dataset AUC: 0.69</pre>\n\n<pre class='language-julia'><code class='language-julia'>let\n    model = StableRulesClassifier\n    hyperparameters = (; max_depth=1, rng=_rng())\n    e = _evaluate(model, hyperparameters, X[:, Not(:year)], y).e\n    Base.Text(string(\"Without `year` AUC: \", _score(e)))\nend</code></pre>\n<pre id='var-hash642468' class='code-output documenter-example-output'>Without `year` AUC: 0.68</pre>\n\n\n<div class=\"markdown\"><p>For comparison removing the <code>nodes</code> feature does reduce the predictive performance:</p>\n</div>\n\n<pre class='language-julia'><code class='language-julia'>let\n    model = StableRulesClassifier\n    hyperparameters = (; max_depth=1, rng=_rng())\n    e = _evaluate(model, hyperparameters, X[:, Not(:nodes)], y).e\n    Base.Text(string(\"Without `nodes` AUC: \", _score(e)))\nend</code></pre>\n<pre id='var-hash780419' class='code-output documenter-example-output'>Without `nodes` AUC: 0.58</pre>\n\n","category":"page"},{"location":"#Conclusion","page":"StableTrees","title":"Conclusion","text":"","category":"section"},{"location":"","page":"StableTrees","title":"StableTrees","text":"<div class=\"markdown\">\n\n<p>Compared to decision trees, the rule-based classifier is more stable, more accurate and similarly easy to interpet. Compared to the random forest, the rule-based classifier is only slightly less accurate, but much easier to interpet. Due to the interpretability, it is likely that the rule-based classifier will be more accurate in real-world settings. This makes rule-based highly suitable for many machine learning tasks.</p>\n</div>\n\n\n\n\n\n\n\n\n\n\n\n\n\n","category":"page"},{"location":"#Acknowledgements","page":"StableTrees","title":"Acknowledgements","text":"","category":"section"},{"location":"","page":"StableTrees","title":"StableTrees","text":"<div class=\"markdown\">\n\n<p>Thanks to Clément Bénard, Gérard Biau, Sébastian da Veiga and Erwan Scornet for creating the SIRUS algorithm and documenting it extensively. Special thanks to Clément Bénard for answering my questions regarding the implementation. Also thanks to my PhD supervisors Ruud den Hartigh, Peter de Jonge and Frank Blaauw, and Age de Wit and colleagues at the Dutch Ministry of Defence for providing the data clarifying the constraints of the problem and for providing many methodological suggestions.</p>\n</div>\n\n","category":"page"},{"location":"#Appendix","page":"StableTrees","title":"Appendix","text":"","category":"section"},{"location":"","page":"StableTrees","title":"StableTrees","text":"<div class=\"markdown\">\n\n</div>\n\n<pre class='language-julia'><code class='language-julia'>begin\n    ENV[\"DATADEPS_ALWAYS_ACCEPT\"] = \"true\"\n\n    using CairoMakie\n    using CategoricalArrays: categorical\n    using CSV: CSV\n    using DataDeps: DataDeps, DataDep, @datadep_str\n    using DataFrames: DataFrame, Not, dropmissing!, filter!, nrow, rename!, select!\n    using LightGBM.MLJInterface: LGBMClassifier\n    using MLJDecisionTreeInterface: DecisionTree, DecisionTreeClassifier\n    using MLJ: CV, MLJ, Not, PerformanceEvaluation, auc, fit!, evaluate, machine\n    using StableRNGs: StableRNG\n    using StableTrees\n    using Statistics: mean\nend</code></pre>\n\n\n<pre class='language-julia'><code class='language-julia'>function _plot_cutpoints(data::AbstractVector)\n    fig = Figure(; resolution=(800, 100))\n    ax = Axis(fig[1, 1])\n    cutpoints = Float64.(unique(ST._cutpoints(data, 10)))\n    scatter!(ax, data, fill(1, length(data)))\n    vlines!(ax, cutpoints; color=:black, linestyle=:dash)\n    textlocs = [(c, 1.1) for c in cutpoints]\n    for cutpoint in cutpoints\n        annotation = string(round(cutpoint; digits=2))::String\n        text!(ax, cutpoint + 0.2, 1.08; text=annotation, textsize=13)\n    end\n    ylims!(ax, 0.9, 1.2)\n    hideydecorations!(ax)\n    return fig\nend;</code></pre>\n\n\n<pre class='language-julia'><code class='language-julia'>_rng(seed::Int=1) = StableRNG(seed);</code></pre>\n\n\n<pre class='language-julia'><code class='language-julia'>function _io2text(f::Function)\n    io = IOBuffer()\n    f(io)\n    s = String(take!(io))\n    return Base.Text(s)\nend;</code></pre>\n\n\n<pre class='language-julia'><code class='language-julia'>function _evaluate(model, X, y; nfolds=10)\n    resampling = CV(; nfolds, shuffle=true, rng=_rng())\n    acceleration = MLJ.CPUThreads()\n    evaluate(model, X, y; acceleration, verbosity=0, resampling, measure=auc)\nend;</code></pre>\n\n\n\n\n\n<pre class='language-julia'><code class='language-julia'>function register_haberman()\n    name = \"Haberman\"\n    message = \"Slightly modified copy of Haberman's Survival Data Set\"\n    remote_path = \"https://github.com/rikhuijzer/haberman-survival-dataset/releases/download/v1.0.0/haberman.csv\"\n    checksum = \"a7e9aeb249e11ac17c2b8ea4fdafd5c9392219d27cb819ffaeb8a869eb727a0f\"\n    DataDeps.register(DataDep(name, message, remote_path, checksum))\nend;</code></pre>\n\n\n<pre class='language-julia'><code class='language-julia'>function _haberman()\n    register_haberman()\n    dir = datadep\"Haberman\"\n    path = joinpath(dir, \"haberman.csv\")\n    df = CSV.read(path, DataFrame)\n    df[!, :survival] = categorical(df.survival)\n    # Need Floats for the LGBMClassifier.\n    for col in [:age, :year, :nodes]\n        df[!, col] = float.(df[:, col])\n    end\n    return df\nend;</code></pre>\n\n\n<pre class='language-julia'><code class='language-julia'>_filter_rng(hyper::NamedTuple) = Base.structdiff(hyper, (; rng=:foo));</code></pre>\n\n\n<pre class='language-julia'><code class='language-julia'>_pretty_name(modeltype) = last(split(string(modeltype), '.'));</code></pre>\n\n\n<pre class='language-julia'><code class='language-julia'>function _evaluate(modeltype, hyperparameters, X, y)\n    model = modeltype(; hyperparameters...)\n    e = _evaluate(model, X, y)\n    row = (;\n        Model=_pretty_name(modeltype),\n        Hyperparameters=_hyper2str(_filter_rng(hyperparameters)),\n        AUC=_score(e),\n        se=round(only(MLJ.MLJBase._standard_errors(e)); digits=2)\n    )\n    (; e, row)\nend;</code></pre>\n\n\n<pre class='language-julia'><code class='language-julia'>_hyper2str(hyper::NamedTuple) = hyper == (;) ? \"(;)\" : string(hyper)::String;</code></pre>\n\n\n<pre class='language-julia'><code class='language-julia'>function _score(e::PerformanceEvaluation)\n    return round(only(e.measurement); digits=2)\nend;</code></pre>\n\n\n<pre class='language-julia'><code class='language-julia'>e1 = let\n    model = DecisionTreeClassifier\n    hyperparameters = (; max_depth=2, rng=_rng())\n    _evaluate(model, hyperparameters, X, y)\nend;</code></pre>\n\n\n<pre class='language-julia'><code class='language-julia'>e2 = let\n    model = StableRulesClassifier\n    hyperparameters = (; max_rules=5, rng=_rng())\n    _evaluate(model, hyperparameters, X, y)\nend;</code></pre>\n\n\n<pre class='language-julia'><code class='language-julia'>e3 = let\n    model = StableRulesClassifier\n    hyperparameters = (;  max_rules=25, rng=_rng())\n    _evaluate(model, hyperparameters, X, y)\nend;</code></pre>\n\n\n<pre class='language-julia'><code class='language-julia'>e4 = let\n    model = StableRulesClassifier\n    hyperparameters = (; max_depth=1, rng=_rng())\n    _evaluate(model, hyperparameters, X, y)\nend;</code></pre>\n\n\n<pre class='language-julia'><code class='language-julia'>e5 = let\n    model = StableForestClassifier\n    hyperparameters = (; max_depth=2, rng=_rng())\n    _evaluate(model, hyperparameters, X, y)\nend;</code></pre>\n\n\n<pre class='language-julia'><code class='language-julia'>e6 = let\n    model = LGBMClassifier\n    hyperparameters = (; )\n    _evaluate(model, hyperparameters, X, y)\nend;</code></pre>\n\n\n<!-- PlutoStaticHTML.End -->","category":"page"},{"location":"","page":"StableTrees","title":"StableTrees","text":"EditURL = \"https://github.com/rikhuijzer/StableTrees.jl/blob/main/docs/src/stabletrees.jl\"","category":"page"}]
}
